import React from 'react';
import { NavLink } from 'react-router-dom';
import { Nav, Navbar } from 'react-bootstrap';
import './Navbar.css';

const NavbarComponent = () => {
    return (
        <Navbar class="navbar navbar-expand-lg navbar-dark shadow-5-strong" fixed="top">
            <div class="container">
                <Navbar.Brand href="/"><img src="img/logo.png" alt="" title="" height="40px" width="40px"></img></Navbar.Brand>
                <Nav className="ml-auto">
                    <NavLink to="/"><p>HOME</p></NavLink>
                    <NavLink to="/final_project"><p>FINAL PROJECT</p></NavLink>
                </Nav>
            </div>
        </Navbar>
    )
}

export default NavbarComponent
